(window.webpackJsonp=window.webpackJsonp||[]).push([[1],{"/gcp":function(e,a,o){"use strict";o.r(a);var r=o("AmI+"),t=o("I1m2"),n=o("1j2H");a.default={en:{translation:r},es:{translation:t},"pt-BR":{translation:n}}},"1j2H":function(e){e.exports=JSON.parse('{"page-title":"COVID-19: Legislação de Proteção Global e Mobilização pelo Acesso à Moradia","modal":{"title":"COVID-19: Legislação de Proteção Global e Mobilização pelo Acesso à Moradia","warning":"Nós sabemos que os despejos estão acontecendo apesar de existerem recursos legais de proteção. Por favor, preenche este questionário para ajudar a mapear e coletar informações sobre os despejos onde você mora. Você pode usar este mapa para encontrar ajuda jurídica e grupos de apoio na sua região. Se você está sendo alvo de ameaças de despejo, <a href=\'https://airtable.com/shrHbY2q4ZmFtkB9d\' target=\'_blank rel=\'noreferrer noopener\'>preencha este questionário aqui</a>.","content":{"paragraph-1":"Este mapa é parte de uma resposta de emergência com o objetivo de compartilhar informações sobre legislação de proteção e ações de defesa da moradia durante a pandemia. Ele foi feito pelo Projeto de Mapeamento Contra os Despejos (AEMP), um coletivo de visualização, análise e narrativas de vida com grupos em São Francisco, Los Angeles, Nova Iorque e colaboradores em várias partes do mundo.","paragraph-2":"AEMP agrega data usando tecnologias livres e de código aberto para apoiar movimentos sociais e grupos de pesquisa para promover a justiça no acesso à moradia. Os dados são coletados de forma colaborativa e não é exaustivo ou perfeito.","paragraph-3":"Para aprender mais sobre as proteções à moradia e a metodologia que adotamos, veja aqui. Para visualizar os dados, <a href=\'#\' target=\'_blank\' rel=\'noreferrer noopener\'>clique aqui</a>","paragraph-4":"O grupo de Mapeamento Contra Despejos reconhece que estamos mapeando territórios indigenas que foram saqueados, colonizados, dividimos e renomeados. Nosso objetivo é de demonstrar respeito aos ocupantes originais das terras com a utilização de nomes indigenas, mas uma limitação dos serviços que utilizamos nós impede de implementar a modificação neste momento.","paragraph-5":"O grupo de Mapeamento Contra Despejos mantém relação pŕoxima com várias organizações na luta pela moradia. O desenvolvimento deste mapa contou com a ajuda do <a href=\'https://mappingaction.org/\' target=\'_blank rel=\'noreferrer noopener\'>Mapping Action Collective</a>, <a href=\'http://www.tenantstogether.org/\' target=\'_blank rel=\'noreferrer noopener\'>Tenants Together</a>, <a href=\'http://sfadc.org/landingpage/covid-19/\' target=\'_blank rel=\'noreferrer noopener\'>San Francisco Anti-Displacement Coalition</a>, <a href=\'https://ebho.org/\' target=\'_blank rel=\'noreferrer noopener\'>organizações em torno da East Bay Housing</a>, <a href=\'http://communityjusticeproject.com/\' target=\'_blank rel=\'noreferrer noopener\'>Community Justice Project</a>, <a href=\'https://www.law.columbia.edu/faculty/emily-benfer\' target=\'_blank rel=\'noreferrer noopener\'>Dr. Emily Benfer</a> e <a href=\'https://docs.google.com/spreadsheets/u/1/d/e/2PACX-1vTH8dUIbfnt3X52TrY3dEHQCAm60e5nqo0Rn1rNCf15dPGeXxM9QN9UdxUfEjxwvfTKzbCbZxJMdR7X/pubhtml?gid=1277129435&single=true&urp=gmail_link\' target=\'_blank rel=\'noreferrer noopener\'> seus estudantes de direito</a>, e <a href=\'https://bayarearentstrike.org/\' target=\'_blank rel=\'noreferrer noopener\'>organizadores do Bay Area Rent Strike (BARS)</a>, bem como a assistência de grupos internacionais de pesquisa como <a href=\'https://notanatlas.org/about/\' target=\'_blank rel=\'noreferrer noopener\'>Kollektiv Orangotango</a> e <a href=\'https://housingnotprofit.org/\' target=\'_blank rel=\'noreferrer noopener\'>Coalizão Européia pelo Direito à Moradia</a>. Nós também agradecemos a ajuda dos grupos <a href=\'https://righttothecity.org/\' target=\'_blank rel=\'noreferrer noopener\'>Right To The City Alliance</a>, <a href=\'https://www.policylink.org/\' target=\'_blank rel=\'noreferrer noopener\'>Policy Link</a>, <a href=\'https://www.pdx.edu/profile/lisa-bates\' target=\'_blank rel=\'noreferrer noopener\'>Dr. Lisa Bates</a>, e <a href=\'http://www.publicjustice.org/en/john-pollock-attorney/\' target=\'_blank rel=\'noreferrer noopener\'>John Pollock</a> da organização Public Justice, Greg Townley do coletivo <a href=\'https://www.psuf.org/homelessness-research-action-collaborative\' target=\'_blank rel=\'noreferrer noopener\'>Homelessness Research Action</a>, e Leeor Schwitzer do grupo <a href=\'https://www.pdxtu.org/\' target=\'_blank rel=\'noreferrer noopener\'>Portland Tenants United</a>."}},"titlebox":{"title":"COVID-19: Legislação de Proteção e Mobilização pelo Acesso à Moradia","about-map":"Sobre o mapa:","aemp-name":"The Anti-Eviction Mapping Project","about-protections":"Legislação de Proteção à Moradia","about-description":"Lugares onde foram aprovadas (ou tramitam) leis de proteção à moradia durante a crise do coronavírus.","legislation-form-usa":"","legislation-form-intl":"Envie informações sobre novas leis de garantia à moradia de sua localidade.","housing-action-title":"Mobilização pelo Acesso à Moradia","housing-action-description":"Onde <strong class=\'color-rent-strike\'>ações de acesso à moradia</strong> estão ocorrendo ou ocorreram.","housing-action-form":"Envie informações sobre ações pelo acesso à moradia de sua região (como ocupações, suspensão de alugueis, etc.)","resources":{"title":"","description":"","right-to-the-city":"","european-action-coalition":"","hashtag-cancel-rent":""}},"searchbar":{"default-value":"Digite a localidade","not-found":"Proteções não foram encontradas para esta localidade"},"infowindow":{"policy":{"title":"Legislação de Proteção à Moradia","jurisdictionType":{"city":"Cidade","county":"Região","state-province":"Estado","nation":"Nações"},"strength-label":"Nível de proteção:","protections-end-label":"Data do fim da proteção:","legislative-end-label":"Data de fim da legislação:","rent-relief-end-label":"Data de fim da suspensão de aluguel:","court-closure-end-label":"Data do fim do impedimento legal de despejos:","start-date-label":"Inicio efetivo:","end-date-label":"Fim:","summary-label":"Resumo da política:","info-link":"Acesse maiores informacoes."},"action":{"title":"Ação em defesa do direito de acesso à moradia","loc-label":"Localização:","status-label":"Situação:","why-label":"Por quê?","strike-type-label":"Tipo de ação:","start-date-label":"Início:","resources-label":"Recursos de apoio:"}},"layer-select":{"cities":"Proteção municipal","counties":"Proteção regional","states":"Proteção estadual","nations":"Proteção federal","housingJusticeAction":"Ações em defesa da moradia"},"policy-strength":{"1":"Poucas proteções aprovadas","2":"Algumas proteções aprovadas","3":"Muitas proteções aprovadas","expired":"Indica proteções que não são mais válidas","missingData":"Dados não disponíveis"}}')},"AmI+":function(e){e.exports=JSON.parse('{"page-title":"COVID-19 Global Housing Protection Legislation and Housing Justice Action Map","modal":{"title":"COVID-19 Global Housing Protection Legislation and Housing Justice Action Map","warning":"We know that evictions are happening despite protections, and that many protections have expired. Please fill out our survey on the map to add information about evictions where you live. You can also use the map to find legal aid and community organizers in your area. If you are experiencing eviction or landlord harassment, you can also fill out our <a href=\'https://airtable.com/shrHbY2q4ZmFtkB9d\' target=\'_blank rel=\'noreferrer noopener\'>survey here</a>.","content":{"paragraph-1":"This map is an emergency response project to present COVID-19 global housing legislation and housing justice action information. It is by the Anti-Eviction Mapping Project, a data-visualization, data analysis, and storytelling collective with chapters primarily in San Francisco, Los Angeles, and New York as well as collaborators worldwide.","paragraph-2":"The Anti-Eviction Mapping Project aggregates data using free and open-source technologies to support social movements, community organizations, and research groups working toward housing justice. Data is crowd-sourced and by no means perfectly or exhaustively.","paragraph-3":"To learn more about our US housing protection scoring methodology, see here. To view a table of the data itself, see <a href=\'#\' target=\'_blank\' rel=\'noreferrer noopener\'>here</a>","paragraph-4":"The Anti-Eviction Mapping Project recognizes that we are mapping Indigenous lands that have been stolen, colonized, divided, and renamed. Colonial and nation-state are depicted because tenant protection legislation exists within these borders. Our goal is to pay our respect to the original stewards of the land by using Indigenous names whenever a limitation from a third-party service that we depend allows us to implement this modification.","paragraph-5":"While the Anti-Eviction Mapping Project maintains close relationships with a number of tenant organizations and networks, this development of this map has in particular relied upon collaboration with the <a href=\'https://mappingaction.org/\' target=\'_blank rel=\'noreferrer noopener\'>Mapping Action Collective</a>, <a href=\'http://www.tenantstogether.org/\' target=\'_blank rel=\'noreferrer noopener\'>Tenants Together</a>, the <a href=\'http://sfadc.org/landingpage/covid-19/\' target=\'_blank rel=\'noreferrer noopener\'>San Francisco Anti-Displacement Coalition</a>,  <a href=\'https://ebho.org/\' target=\'_blank rel=\'noreferrer noopener\'>East Bay Housing Organizations</a>, <a href=\'http://communityjusticeproject.com/\' target=\'_blank rel=\'noreferrer noopener\'>Community Justice Project</a>, <a href=\'https://www.law.columbia.edu/faculty/emily-benfer\' target=\'_blank rel=\'noreferrer noopener\'>Dr. Emily Benfer</a> and <a href=\'https://docs.google.com/spreadsheets/u/1/d/e/2PACX-1vTH8dUIbfnt3X52TrY3dEHQCAm60e5nqo0Rn1rNCf15dPGeXxM9QN9UdxUfEjxwvfTKzbCbZxJMdR7X/pubhtml?gid=1277129435&single=true&urp=gmail_link\' target=\'_blank rel=\'noreferrer noopener\'>her law students</a>, and <a href=\'https://bayarearentstrike.org/\' target=\'_blank rel=\'noreferrer noopener\'>Bay Area Rent Strike (BARS)</a> organizers, as well as assistance in international research from our friends at <a href=\'https://notanatlas.org/about/\' target=\'_blank rel=\'noreferrer noopener\'>kollektiv orangotango</a> and the <a href=\'https://housingnotprofit.org/\' target=\'_blank rel=\'noreferrer noopener\'>European Action Coalition for the Right to Housing</a>. We are grateful for consultation from <a href=\'https://righttothecity.org/\' target=\'_blank rel=\'noreferrer noopener\'>Right To The City Alliance</a>, <a href=\'https://www.policylink.org/\' target=\'_blank rel=\'noreferrer noopener\'>Policy Link</a>, <a href=\'https://www.pdx.edu/profile/lisa-bates\' target=\'_blank rel=\'noreferrer noopener\'>Dr. Lisa Bates</a>, and <a href=\'http://www.publicjustice.org/en/john-pollock-attorney/\' target=\'_blank rel=\'noreferrer noopener\'>John Pollock</a> from Public Justice, Greg Townley from the <a href=\'https://www.psuf.org/homelessness-research-action-collaborative\' target=\'_blank rel=\'noreferrer noopener\'>Homelessness Research Action Collaborative</a>, and Leeor Schwitzer from <a href=\'https://www.pdxtu.org/\' target=\'_blank rel=\'noreferrer noopener\'>Portland Tenants United</a>."}},"titlebox":{"title":"COVID-19 Global Housing Protection Legislation & Housing Justice Action","about-map":"MAP KEY","aemp-name":"The Anti-Eviction Mapping Project","about-protections":"Housing Protection Legislation","about-description":"Where officials have passed (or tenants are working to pass) housing protection legislation during the COVID-19 crisis.","legislation-form-usa":"Housing Protection Legislation for locations in the United States.","legislation-form-intl":"Housing Protection Legislation for locations outside United States.","housing-action-title":"Housing Justice Action","housing-action-description":"Where <strong class=\'color-rent-strike\'>housing justice actions</strong> are occurring or have occured.","housing-action-form":"Housing justice actions around the world.","submit":"Submit data","resources":{"title":"Resources","right-to-the-city":"Demands from Right To The City Alliance and Homes For All.","european-action-coalition":"Resources and demands from the European Action Coalition for the Right to Housing.","hashtag-cancel-rent":"Rent Strike resources for #CancelRent."}},"searchbar":{"default-value":"Search location","not-found":"No tenant protections listed for this location"},"infowindow":{"policy":{"title":"Housing Protection Legislation","jurisdictionType":{"city":"City","county":"County","state-province":"State/Province","nation":"Nation"},"strength-label":"Policy Strength:","protections-end-label":"Protections End Date:","legislative-end-label":"Legislation Protections End Date:","rent-relief-end-label":"Rent Relief Protections End Date:","court-closure-end-label":"Court Closures End Date:","start-date-label":"Effective:","end-date-label":"Ends:","summary-label":"Policy Summary:","info-link":"View more info.","resource-link":"View associated resource."},"action":{"title":"Housing Justice Action","loc-label":"Location:","status-label":"Rent striking?","why-label":"Why?","strike-type-label":"Action Type:","start-date-label":"Start:","resources-label":"Resources:"}},"layer-select":{"cities":"City Protections","counties":"County Protections","states":"State/Province Protections","nations":"National Protections","housingJusticeAction":"Housing Justice Actions"},"policy-strength":{"1":"Few tenant protections","2":"Some tenant protections","3":"Many tenant protections","expired":"Stripes indicate expired protections","missingData":"Missing data"}}')},I1m2:function(e){e.exports=JSON.parse('{"page-title":"Protección de Emergencia Global para Inquilinos y movilización contra los desalojos durante la pandemia COVID-19","modal":{"title":"Protección de Emergencia Global para Inquilinos y movilización contra los desalojos durante la pandemia COVID-19","warning":"Sabemos que se están produciendo desalojos a pesar de las protecciones, y que muchas protecciones han expirado.Por favor, rellene nuestro cuestionario en el mapa para añadir información sobre los desalojos en el lugar donde vive.  También puede usar el mapa para encontrar ayuda legal y organizadores comunitarios en su área. Si está experimentando un desalojo o acoso por parte del propietario, también puede rellenar nuestro <a href=\'https://airtable.com/shrHbY2q4ZmFtkB9d\' target=\'_blank rel=\'noreferrer noopener\'>cuestionario aquí</a>.","content":{"paragraph-1":"Este mapa es un proyecto de respuesta de emergencia para presentar la legislación mundial sobre vivienda de COVID-19 y la información sobre la acción de la justicia en materia de vivienda. Es realizado por el Proyecto de Mapeo Antidesalojo, un colectivo de visualización de datos, análisis de datos y narración de historias de vida con capítulos principalmente en San Francisco, Los Ángeles y Nueva York, así como colaboradores en todo el mundo.","paragraph-2":"El proyecto de cartografía contra el desalojo reúne datos utilizando tecnologías libres y de código abierto para apoyar a los movimientos sociales, las organizaciones comunitarias y los grupos de investigación que trabajan en pro de la justicia en materia de vivienda. Los datos son de origen colectivo y de ninguna manera son perfectos o exhaustivos.","paragraph-3":"Para aprender más sobre nuestra metodología de puntuación de protección de la vivienda en EE.UU., vea aquí. Para ver una tabla de los datos en sí, ver <a href=\'#\' target=\'_blank\' rel=\'noreferrer noopener\'>aquí</a>","paragraph-4":"El colectivo AEMP reconoce que estamos cartografiando las tierras indígenas que han sido robadas, colonizadas, divididas y rebautizadas. Se describen las colonias y los estados nacionales porque la legislación de protección de los arrendatarios existe dentro de estas fronteras. Nuestro objetivo es presentar nuestro respeto a los administradores originales de la tierra utilizando los nombres indígenas siempre que una limitación de un servicio de terceros del que dependemos nos permita aplicar esta modificación.","paragraph-5":"Si bien el Proyecto de Cartografía contra el Desalojo mantiene estrechas relaciones con una serie de organizaciones y redes de inquilinos, la elaboración de este mapa se ha basado en particular en la colaboración con el <a href=\'https://mappingaction.org/\' target=\'_blank rel=\'noreferrer noopener\'>Mapping Action Collective</a>, <a href=\'http://www.tenantstogether.org/\' target=\'_blank rel=\'noreferrer noopener\'>Tenants Together</a>, the <a href=\'http://sfadc.org/landingpage/covid-19/\' target=\'_blank rel=\'noreferrer noopener\'>San Francisco Anti-Displacement Coalition</a>, <a href=\'https://ebho.org/\' target=\'_blank rel=\'noreferrer noopener\'>East Bay Housing</a>, <a href=\'http://communityjusticeproject.com/\' target=\'_blank rel=\'noreferrer noopener\'>Community Justice Project</a>, <a href=\'https://www.law.columbia.edu/faculty/emily-benfer\' target=\'_blank rel=\'noreferrer noopener\'>Dr. Emily Benfer</a> y <a href=\'https://docs.google.com/spreadsheets/u/1/d/e/2PACX-1vTH8dUIbfnt3X52TrY3dEHQCAm60e5nqo0Rn1rNCf15dPGeXxM9QN9UdxUfEjxwvfTKzbCbZxJMdR7X/pubhtml?gid=1277129435&single=true&urp=gmail_link\' target=\'_blank rel=\'noreferrer noopener\'>sus estudiantes de derecho</a>, y <a href=\'https://bayarearentstrike.org/\' target=\'_blank rel=\'noreferrer noopener\'>organizadores Bay Area Rent Strike (BARS)</a>, así como la asistencia en la beca internacional de nuestros amigos de <a href=\'https://notanatlas.org/about/\' target=\'_blank rel=\'noreferrer noopener\'>Kollektiv Orangotango</a> y <a href=\'https://housingnotprofit.org/\' target=\'_blank rel=\'noreferrer noopener\'>European Action Coalition for the Right to Housing</a>. Agradecemos la consulta de <a href=\'https://righttothecity.org/\' target=\'_blank rel=\'noreferrer noopener\'>Right To The City Alliance</a>, <a href=\'https://www.policylink.org/\' target=\'_blank rel=\'noreferrer noopener\'>Policy Link</a>, <a href=\'https://www.pdx.edu/profile/lisa-bates\' target=\'_blank rel=\'noreferrer noopener\'>Dr. Lisa Bates</a>, y <a href=\'http://www.publicjustice.org/en/john-pollock-attorney/\' target=\'_blank rel=\'noreferrer noopener\'>John Pollock</a> de Public Justice, Greg Townley de <a href=\'https://www.psuf.org/homelessness-research-action-collaborative\' target=\'_blank rel=\'noreferrer noopener\'>Homelessness Research Action Collaborative</a>, y Leeor Schwitzer de <a href=\'https://www.pdxtu.org/\' target=\'_blank rel=\'noreferrer noopener\'>Portland Tenants United</a>."}},"titlebox":{"title":"Protección de Emergencia para Inquilinos y movilización contra los desalojos durante la pandemia COVID-19","about-map":"Sobre el mapa:","aemp-name":"Anti-Eviction Mapping Project","about-protections":"Legislación de protección","about-description":"En el contexto de la pandemia, estamos mapeando en qué ciudades, condados, estados los gobiernos han aprobado (o donde los inquilinos trabajan para lograr aprobar) legislación de emergencia que suspenda desalojos o asegure la permanencia de los inquilinos en sus hogares.","legislation-form-usa":"Envie información sobre legislación de protección para los lugares en los Estados Unidos.","legislation-form-intl":"Envie información sobre legislación de protección fuera de los Estados Unidos.","housing-action-title":"Movilización para la defensa de la vivienda","housing-action-description":"Donde <strong class=\'color-rent-strike\'>acciones para la justicia</strong> están ocurriendo o han ocurrido.","housing-action-form":"Complete para presentar la información sobre: Organización, resistencia y ayuda mutua en forma de huelgas de alquiler, recuperación de viviendas, ocupaciones y más. También llene si busca las redes de solidaridad y recursos para ayudar a cancelar el alquiler.","resources":{"title":"Recursos de apoyo","description":"Aquí hay algunos recursos para obtener ayuda si usted está en necesidad.","right-to-the-city":"Recursos y demandas de Right To The City Alliance y Homes For All.","european-action-coalition":"Recursos y demandas de la Coalición de Acción Europea por el Derecho a la Vivienda.","hashtag-cancel-rent":"Recursos de Rent Strike para #CancelRent."}},"searchbar":{"default-value":"Digita una localización","not-found":"No hay protecciones para esta ubicación"},"infowindow":{"policy":{"title":"Legislación de protección","jurisdictionType":{"city":"Ciudad","county":"Condado","state-province":"Estado/Provincia","nation":"Nación"},"strength-label":"Fuerza de la política publica:","protections-end-label":"Fecha de finalización de la protección:","legislative-end-label":"Fecha límite de protección de la legislación:","rent-relief-end-label":"Fecha de finalización de la protección del alquiler:","court-closure-end-label":"Fecha de cierre del tribunal:","start-date-label":"Efectivo","end-date-label":"Finaliza:","summary-label":"Resumen de la política","info-link":"Ver más información"},"action":{"title":"Movilización por el derecho a la vivienda","loc-label":"Localización:","status-label":"Status:","why-label":"¿Por qué?","strike-type-label":"Tipo de movilización:","start-date-label":"Inicio:","resources-label":"Recursos:"}},"layer-select":{"cities":"Protecciones municipales","counties":"Protecciones del condado","states":"Protecciones del estado","nations":"Protecciones nacionales","housingJusticeAction":"Movilización por el derecho a la vivienda"},"policy-strength":{"1":"Pocas protecciones en vigor","2":"Algunas protecciones en vigor","3":"Muchas protecciones en vigor","expired":"Las rayas indican protecciones caducadas","missingData":"Datos no disponibles"}}')}}]);
